import { Component } from '@angular/core';
import { GlobalData } from '../../shared/utils/data';

@Component({
  selector: 'app-sell',
  templateUrl: './sell.component.html',
  styles: [],
})
export class SellComponent {
  data: any = GlobalData;

  file: any;

  body: any = {
    name:'',
    city: '',
    bed: '',
    bath: '',
    garage: '',
    area: '',
    image: '',
  };

  // Setter for body
  setName(e:any){
    this.body.name = e.value;
  }
  setCity(e: any) {
    this.body.city = e.value;
  }
  setBed(e: any) {
    this.body.bed = e.value;
  }
  setBath(e: any) {
    this.body.bath = e.value;
  }
  setGarage(e: any) {
    this.body.garage = e.value;
  }
  setArea(e: any) {
    this.body.area = e.value;
  }
  setPrice(e: any) {
    this.body.price = e.value;
  }

  setFile(e: any) {
    this.file = e.value;
  }
}
